import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(0);

  const styles = {
    container: {
      minHeight: "100vh",
      backgroundColor: "#f3f4f6",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      fontFamily: "Arial, sans-serif",
      padding: "20px"
    },
    card: {
      backgroundColor: "white",
      padding: "32px",
      borderRadius: "12px",
      boxShadow: "0 10px 25px rgba(0,0,0,0.1)",
      textAlign: "center",
      maxWidth: "400px",
      width: "100%"
    },
    title: {
      fontSize: "2.5rem",
      fontWeight: "bold",
      color: "#1f2937",
      marginBottom: "16px"
    },
    subtitle: {
      fontSize: "1.125rem",
      color: "#6b7280",
      marginBottom: "24px"
    },
    successBox: {
      backgroundColor: "#ecfdf5",
      border: "1px solid #d1fae5",
      borderRadius: "8px",
      padding: "16px",
      marginBottom: "24px"
    },
    successText: {
      color: "#065f46",
      fontWeight: "500"
    },
    successSubtext: {
      color: "#047857",
      fontSize: "0.875rem",
      marginTop: "8px"
    },
    button: {
      backgroundColor: "#3b82f6",
      color: "white",
      padding: "12px 24px",
      borderRadius: "8px",
      border: "none",
      fontSize: "16px",
      fontWeight: "600",
      cursor: "pointer",
      transition: "background-color 0.2s"
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h1 style={styles.title}>
          Health App
        </h1>
        <p style={styles.subtitle}>
          Macro Tracker & Fitness Goals
        </p>
        <div style={styles.successBox}>
          <p style={styles.successText}>React is Working!</p>
          <p style={styles.successSubtext}>
            Ready for macro tracking features
          </p>
        </div>
        <button 
          style={styles.button}
          onClick={() => setCount(count + 1)}
          onMouseOver={(e) => e.target.style.backgroundColor = "#2563eb"}
          onMouseOut={(e) => e.target.style.backgroundColor = "#3b82f6"}
        >
          Test Button: {count}
        </button>
      </div>
    </div>
  );
}

export default App;
